// src/FilmList.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const FilmList = () => {
    const [films, setFilms] = useState([]);

    // Fetch data from the backend when the component mounts
    useEffect(() => {
        // Change the URL to your Spring Boot backend
        axios.get('http://localhost:8080/films')
            .then(response => {
                setFilms(response.data); // Store the fetched films data in state
            })
            .catch(error => {
                console.error('There was an error fetching the films!', error);
            });
    }, []); // Empty dependency array means this runs once when the component mounts

    return (
        <div>
            <h1>Film Tracker</h1>
            <ul>
                {films.map(film => (
                    <li key={film.id}>{film.name} ({film.releaseDate})</li>
                ))}
            </ul>
        </div>
    );
}

export default FilmList;
